import React, { Component } from "react";
import { connect } from "react-redux";
import { getClients } from "../src/Actions/ClientActions";
import PropTypes from "prop-types";
import Clientitem from "./Actions/Clientitem";
import { Link } from "react-router-dom";
import {
  CBadge,
  CCard,
  CCardBody,
  CCardHeader,
  CCol,
  CDataTable,
  CRow,
} from "@coreui/react";

const styleBackground = {
  backgroundColor: "#34495e",
};
class Tables extends Component {
  componentDidMount() {
    this.props.getClients();
  }

  render() {
    const { clients } = this.props.client;
    return (
      <div className="content-wrapper">
        <div className="container">
          <div className="projects">
            <div className="container">
              <div className="row">
                <div className="col-md-12">
                  <h1 className="display-4 text-center">Clients</h1>
                  <br />
                  <Link
                    to="addclient"
                    className="btn btn-lg btn-info float-right mb-2"
                  >
                    Add Client
                  </Link>
                  <div className="table-responsive">
                    <table className="table table-striped jambo_table bulk_action">
                      <thead style={styleBackground}>
                        <tr className="headings">
                          <th></th>
                          <th className="column-title">Code Client</th>
                          <th className="column-title">First Name </th>
                          <th className="column-title">Last Name </th>
                          <th className="column-title">Adresse </th>
                          <th className="column-title">Year </th>
                          <th className="column-title">Email </th>
                          <th className="column-title">Phone </th>
                          <th className="column-title no-link last">
                            <span className="nobr">Action</span>
                          </th>
                        </tr>
                      </thead>
                      {clients.map((client) => (
                        <Clientitem key={client.codeClient} client={client} />
                      ))}
                    </table>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
Tables.propTypes = {
  client: PropTypes.object.isRequired,
  getClients: PropTypes.func.isRequired,
};

const mapStateToProps = (state) => ({
  client: state.client,
});

export default connect(mapStateToProps, { getClients })(Tables);
